queryString:
PREFIX conn: <http://example.com/theme/connected/>
SELECT (COUNT(DISTINCT ?entity) AS ?count) WHERE {
  VALUES ?target { 1 2 }
  { ?entity a conn:Node ; conn:connectsTo ?targetNode . }
  UNION
  { ?entity a conn:Node . }
  OPTIONAL { ?entity conn:weight ?w . }
  FILTER(?w = ?target || ?w = 3)
}

